import React, {useState, useEffect} from 'react';
import * as api from '../../../api/api';
const Leauges = ({leagueEntriesInfo}) => {
    const [solorankinfo, setSolorankinfo] = useState('');
    const [tftrankinfo, setTftrankinfo] = useState('');
    const [teamrankinfo, setTeamankinfo] = useState('');
    useEffect(() => {
        if(leagueEntriesInfo) {
            leagueEntriesInfo.map(v => {
                api.getleagueSecond(v.leagueId)
                .then(response => {
                    if(response.data.queue === "RANKED_SOLO_5x5"){
                        setSolorankinfo(response.data.entries);
                    } else if(response.data.queue === "RANKED_FLEX_SR"){
                        setTeamankinfo(response.data.entries);
                    }
                })
                .catch(error => console.log(error))
            })
        }
    },[leagueEntriesInfo])
    return (
        <div>
            <div className="GameItemList">
                <div className="GameItemWrap">
                    <div className="GameItem Win">
                        <div className="Content">

                        </div>
                    </div>
                </div>
            </div>
            <style jsx global>
                {`
                    .GameItemWrap {
                        position: relative;
                        border-radius: 3px;
                        margin-bottom: 8px;
                    }
                    .GameItem {
                        position: relative;
                        background: none;
                    }
                    .GameItem.Win > .Content {
                        table-layout: fixed;
                        background-color: #a3cfec;
                        border-color: #99b9cf;
                    }
                    .GameItem > .Content {
                        display: table;
                        width: 689px;
                        height: 97px;
                        border-collase: collapse;
                        border: 1px solid #cdd2d2;
                    }
                `}
            </style>
        </div>
    );
}

export default Leauges;
